#include<stdio.h>
#include<conio.h>
#define TOTAL_CHARS 53
typedef struct node node;
struct node{
	char c;
	char word;//'y' or 'n'
	//int count;//no. of string having this node as prefix
	node *link[TOTAL_CHARS];//a-z A-Z and space
};
node* createNode(){
	node* t= (node*)malloc(sizeof(node));
	int i;
	for(i=0; i<TOTAL_CHARS; i++)	
		t->link[i]=NULL;
	t->word='n';
	return t;
}
int decode(char c){
	return (c >= 'a' && c <= 'z')?(c-'a'):((c >= 'A' && c <= 'Z')?(c+26-'A'):(52));
}
void appendInTrie(node *root[], char* s, int index){
	if(index >= strlen(s))
		return;
	int pos = decode(s[index]);
	if(root[pos] == NULL){
		root[pos] = createNode();
		root[pos]->c = s[index];
	}
	if(1+index == strlen(s)) 
		root[pos]->word = 'y';
	appendInTrie(root[pos]->link, s, ++index);
}
void makeTrie(node* start[], char* s[], int n){
    //int n = sizeof(s)/sizeof(char*);//number of names
	int i;
	for(i=0; i<n; i++){//for each string
		appendInTrie(start, s[i], 0);
		printf("%s added\n", s[i]);
	}
	printf("Total %d added.\n", n);
}
void triePrintOptions(node* start[], char str[]){//to read the prefix
	int len = strlen(str), i;
	node *t = start[decode(str[0])];
	//char printStr[100]={0};
	for(i=1; i<len; i++){
	//	printStr[i-1] = t->c;
		if(t==NULL) break;
		t = t->link[decode(str[i])];
	}
	//printStr[i-1] = t->c;

	if(t!=NULL && t->word == 'y')
		fputs("Match found.\n", stdout);
	fputs("Options: ", stdout);
	int j, optionCount;
	for(j=0, optionCount=0; j<TOTAL_CHARS; j++)
		if(t == NULL){
			fputs("No Word With Such Prefix Exists. Press any key to exit.", stdout);
            getch();
            exit(0);
		}else if(t->link[j] != NULL){
			((t->link[j]->c)==' ')?(fputs("<space>", stdout)):(putchar(t->link[j]->c));
			optionCount++;
		}
	if(optionCount==0)
		fputs("<none>", stdout);
	puts("");
}
void takeInput(node* start[]){
	char str[100]={0}; int next_char=0;
	puts("Press ENTER to exit and any other key for input.");
	do{
		char c= getch();
		fputs(str, stdout); printf("%c\n", c);
		if(c=='\r' || c=='\n') break;
		str[next_char++]=c;
		triePrintOptions(start, str);
	}while(1);
}
void freeTrie(node* tree){
	int i;
	for(i=0; i<TOTAL_CHARS; i++){
	if(tree->link[i] != NULL)
		freeTrie(tree->link[i]);
	}
	free(tree);
}
